INSERT INTO `content_pages` (`id`, `title`, `category_id`, `dateadded`, `dateupdated`, `slug`, `content`, `author`, `trash`) VALUES
(1, 'SMS Platform', 1, '2014-12-10 09:18:51', '2014-12-10 12:29:00', 'sms-platform', '<p>The platform is being implemented to address the current deficiencies in communication between the electorate and District councilors. The overall goal of this Platform is to facilitate the flow of information, especially information about public service delivery, from sub-county constituents to the district councilors who represent them at the LC5 level. This Platform is providing a method for citizens to send anonymous feedback to their district councilors about public service deficiencies in their villages and towns.</p>\n\n<p>Ultimately, the SMS Platform hopes that opening a new channel for constituents to communicate with their respective district councilors will improve local government service delivery and councilor performance Citizens are free to send messages in their local languages All citizens that are eligible to vote are free to use the service. Cost of the SMS , it is free for AIRTEL/WARID, ORANGE and MTN costs 220 Ug shillings .</p>\n\n<p>The Local Government SMS platform is not an emergency line and should not be used to communicate to councilors on personal matters or those that are not related to the official work of councilors. In any case, the system will filter such messages and ensure that they are not delivered to the intended recipient.</p>\n', 1, 'y'),
(2, 'LGCSCI', 2, '2014-12-10 10:02:22', '0000-00-00 00:00:00', 'lgcsci', '<p>The Uganda Local Government Councils Score-Card Initiative (LGCSCI) is a 10 Year initiative with the goal of strengthening citizens&#39; demand for effective public service delivery and accountability. This goal is achieved through: undertaking annual assessment of the performance of local government councils; publication and dissemination of annual score-cards; and outreach and capacity building to empower citizens and local government leaders. The Initiative is implemented in partnership with the&nbsp;Uganda Local Governments Association&nbsp;(ULGA).</p>\n\n<p><strong><em>The Score-Card initiative seeks to....</em></strong></p>\n\n<ul>\n	<li>support a robust outreach program targeting citizens to educate them about&nbsp; what they should expect from their local leadership; and</li>\n	<li>support the capacity building program for local councilors to understand their mandate as stipulated in the Local Governments Act .</li>\n</ul>\n\n<table align="left" border="0" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td>\n			<p><strong><em>LGCSCI Components;</em></strong></p>\n			</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td colspan="2">\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:95.0%">\n				<tbody>\n					<tr>\n						<td style="width:89.0%">\n						<p><strong><em>Research and Performance Monitoring:</em></strong>&nbsp;The project undertakes an independent annual assessment of the performance of local government councils using the Local Government Councils Score-Card (LGCSC) as a tool for measuring whether the councils and their respective organs are performing their statutory roles. The LGCSC was launched in 2009 with the assessment of the first 10 districts for the FY 2008/09, and had by 2011/12 increased the number of districts to 26. The Score-Card also evaluates the causal relationship between the performance of a local government council and the quality of service delivery in the district.&nbsp;Read more.&nbsp;Out of every Annual scorecard assessment, ACODE produces two major publications: the LGCSCI&nbsp;<a href="http://www.acode-u.org/documents/Synthesis_report_2012.pdf">Synthesis Report</a>&nbsp;that provides a comparative analysis of the findings from the districts covered by the assessment and is disseminated at national level; and the specific district&nbsp;<a href="http://www.acode-u.org/PSDA.html">scorecard reports</a>&nbsp;which provide a detailed analysis of the performance of local government councils in the districts assessed.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>Outreach, Capacity Building and Advocacy</em></strong><strong>:</strong>&nbsp;LGCSCI has robust outreach and capacity building activities including councilors&rsquo; training workshops, community clinics and FGDs, reseachers&rsquo; methodology workshops, innovative tools/products and internships. The activities are packaged to target three primary stakeholders: Citizens, District Council leaders and local CSOs. The Score-Card is not a name and shame of poor performing local governments assessed!&nbsp;Read more.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>Intensive Dissemination</em></strong>: The initiative introduced a new component implemented in partnership with Innovations for Poverty Action (IPA) to specifically focus on educating citizens and citizens groups about three specific types of information, namely: legally defined duties of elected officials, the scorecard performance of elected officials in fulfilling these duties, and the government&#39;s minimum standards of public services to which citizens are entitled. This component mainly facilitates the&nbsp;demand-side approach&nbsp;to addressing the problems of public service delivery through empowering citizens to be the primary actors in the public service delivery architecture in the country.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>The Local Government SMS Platform</em></strong><strong>:</strong>&nbsp;This innovative tool was created to provide and facilitate an-easy-to-use mobile-phone based platform to facilitate the flow of information about public service delivery deficiencies from the constituents to the district councillors on the one hand, and feedback from the councillors to citizens as a way of being accountable to the electorate, on the other hand. The SMS Platform is also designed and implemented in partnership with IPA. The&nbsp;SMS Platformprovides a unique tool for ensuring that citizens remain engaged with their elected leaders at minimal or no cost at all by sending precise text messages about service delivery deficiencies from their mobile phones directly to their elected councilors&#39; phone.</p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 1, 'n'),
(3, 'CBTIC', 2, '2014-12-10 10:12:48', '0000-00-00 00:00:00', 'cbtic', '<p>The Citizens&#39; Budget Tracking and Information Center (CBTIC) is a five-year initiative supported by the Embassy of the Kingdom of the Netherlands in Kampala. Since November 2010, the CBTIC has worked to enhance the demand-side of accountability in Uganda. CBTIC aims at increasing accountability and transparency in the allocation and utilization of both local revenue and donor funds by raising citizens&rsquo; civic awareness. The underlying hypothesis of the initiative is that citizens&rsquo; awareness of the budget processes and budget allocations of both central and local governments will, in addition to increasing accountability, build a strong civic consciousness that is the foundation for good budget governance and economic programmes that effectively target poverty eradication.</p>\n\n<p><strong><em>The CBTIC initiative seeks to....</em></strong></p>\n\n<ul>\n	<li>Promote pro-poor budget priority setting through government revenue profiling, budget allocations, and public expenditure tracking and analysis.</li>\n	<li>Promote budget transparency and accountability through tracking of Government revenue, budget disbursements and budget outturns.</li>\n	<li>Build the civic capacity of citizens and citizen groups about the budget and budget processes through dialogues and timely provision of information.</li>\n</ul>\n\n<table align="left" border="0" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td>\n			<p><strong><em>CBTIC areas of focus;</em></strong></p>\n			</td>\n			<td>&nbsp;</td>\n		</tr>\n		<tr>\n			<td colspan="2">\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:95.0%">\n				<tbody>\n					<tr>\n						<td style="width:89.0%">\n						<p><strong><em>Research and Monitoring</em></strong><strong>:</strong>&nbsp;The paradigm behind the CBTIC is to carry out evidence based advocacy on budget issues including service delivery in Uganda and the region. This requires first and foremost the gathering and analysis of relevant information. The research agenda of the CBTIC includes but is not necessarily limited to; (i) Macroeconomic trends in the country and performance of the economy &ndash; economic growth, unemployment, inflation, taxation, income inequality (poverty and associated indicators) and monetary and fiscal policy (ii)Budget analysis including inter and intra sectoral allocations and government transfers to local governments (iii)Service delivery under decentralization particularly in the education, agriculture, health, water, roads and environment.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>Advocacy and outreach</em></strong><strong>:</strong>&nbsp;Undertake a comprehensive outreach and advocacy campaign to ensure those citizens and citizens&#39; groups access timely and information on budget and budget allocations.See online database.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>Strengthening the capacity of local CSO partners</em></strong>: Existence of local CSO partners with capacity to mobilize and engage citizens is central to the overall strategy of CBTIC. It is through local partnerships that ACODE is building local capacity widening the reach of its activities to millions of citizens who need budget civic awareness. CBTIC therefore works with a number of CSOs and individual researchers as part of this network.</p>\n						</td>\n					</tr>\n					<tr>\n						<td>\n						<p><strong><em>Regional and international budget partnerships and networking</em></strong><strong>:</strong>&nbsp;Uganda&#39;s budget resources include both local revenue as well as foreign aid in the form of grants and loans. Citizens do not have information regarding funds provided through these channels. However, effective monitoring of such funds is largely dependent on effective partnerships with institutions engaged in similar activities around the world. CBTIC works to actively identify and build partnership with selected international and regional organizations engaged in budget policy and budget tracking. Partnerships are pursued to promote mutual learning and experience sharing.</p>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 1, 'n'),
(4, 'About us', 1, '2014-12-10 10:42:09', '0000-00-00 00:00:00', 'about-us', '<p>ACODE is an independent public policy research and advocacy think tank registered in Uganda with operations in the Eastern and Southern Africa sub-region. ACODE was first registered in 1999 as a Non-governmental organization (NGO). In 2004, the organization was incorporated as a company limited by guarantee and without having a share capital. Thirteen years now, ACODE is one of the most dynamic and robust regional leaders in cutting-edge public policy research and analysis in a range of areas including governance, trade, environment, and science and technology. ACODE is non-partisan and independent. As a non-partisan organisation, ACODE does not align with any political party or political organisation. However, given the direct relationship between development policy and politics, ACODE believes that its work is political and it must stand for certain political causes of a bi-partisan nature. Such causes are legitimate issues of research interest so long as they are defined on the basis of constitutionalism, the rule of law as well as national and regional interests as expressed in the relevant treaties, strategy documents and declarations.</p>\n\n<p><strong>Our Vision Statement</strong></p>\n\n<p>To become a &ldquo;premier public policy research and advocacy think tank working for social justice and good governance in Africa.&rdquo; ACODE aspires to become one of the leading public policy think tanks with the goal of ensuring that public policies contribute to improving the quality of life of the people in Africa. ACODE&rsquo;s research and analytical work is designed to equip citizens with the knowledge and information they need to make appropriate choices in business, governance and leadership.</p>\n\n<p><strong>Our Mission Statement</strong></p>\n\n<p>&ldquo;To make public policies work for people.&rdquo; Through Evidence-based policy research and analysis, we create knowledge to support pro-people national and regional development policies. Through Policy outreach and advocacy, we empower people to shape public policies so that they are just and equitable. Through independent monitoring and assessments, we help our partners get the best independent advice on how to improve the quality of their services to the citizens. Through action, we motivate people to demand for responsible government, accountability in leadership and better governance.&nbsp;</p>\n', 1, 'n');
