INSERT INTO `from_dump_yard` (`id`, `from`, `msg`, `to`, `trash`, `dateadded`, `dateupdated`, `status`, `ip_address`, `invalid`, `shortcode`, `guessed`) VALUES
(8, '256779610327', 'Hon. Norbert Mao raises questions on the ethnic composition of military command structures ?does this need to be considered in security Sector reform?', 0, 'n', '2014-12-11 10:15:37', '0000-00-00 00:00:00', '', '8888', '', 0, 0),
(9, '256779610327', 'I don''t want news, I want information! The story of the big politician cutting a tape is not the story of the common man- Trevor Ncube, Media Enterpreneur, Zimbabwe.', 0, 'n', '2014-12-10 10:16:31', '0000-00-00 00:00:00', '', '8888', '', 0, 0),
(10, '256779610327', 'Women are excluded from critical posts at national and international posts; their voices will not be heard yet that are vital to post- conflict resolution Ms. Alidri, Lecturer from Gulu University.', 2338, 'n', '2014-11-09 11:29:21', '0000-00-00 00:00:00', 'u', '', 'y', 0, 0),
(11, '256779610327', 'Don''t use youths negatively; use their excess energy positively for peacemaking Ms. Alidri, Lecturer from Gulu University.', 0, 'n', '2014-12-13 11:12:32', '0000-00-00 00:00:00', 'u', '', 'y', 0, 0),
(12, '256779610327', 'Did you know that Security Sector Reform in Uganda was funded by DFID? The United Kingdom?s Department for International Development worked with Kings College London and Makerere University to include academics.', 0, 'n', '2014-12-13 11:13:21', '0000-00-00 00:00:00', 'u', '', 'y', 0, 0),
(13, '256779610327', 'Dr David Harris from the University of Bradford challenges beliefs that democracies unanimously bring peace, noting the impact of conflict and violence on weak state institutions that adopt democracy.', 0, 'n', '2014-12-13 11:14:04', '0000-00-00 00:00:00', 'u', '', 'y', 0, 0),
(15, '256779610327', 'The Uganda Budget Information website promotes transparency and accountability in the use of public funds by allowing you to access and give feedback on national and local government budgets and performance.', 0, 'n', '2014-12-13 13:12:40', '0000-00-00 00:00:00', 'u', '', 'y', 0, 0);
